import './App.css';
import React from 'react';
import { Route, Routes, useLocation } from 'react-router-dom';
import Header from './Header';
import Home from './util/Home';
import UserPage from './util/UserPage';
import Login from './util/Login';
import Register from './util/Register';

export default function App() {
  const location = useLocation();
  const routesWithHeader = [ '/login', '/register']; // Add routes where you want to display the header

  const shouldDisplayHeader = routesWithHeader.includes(location.pathname) && !location.pathname.startsWith('/');

  return (
    <React.Fragment>
      {shouldDisplayHeader && <Header />}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/welcome/:userId" element={<UserPage />} />
      </Routes>
    </React.Fragment>
  );
}





